import React, { Component } from 'react';
import './App.css';

const illnesses = ["Common cold",
  "Nausea",
  "Mental Health",
  "Migraines",
  "Digestive Disorders",
  "Eye health",
  "Food Poisoning",
  "Kidney Stones",
  "Dermotology",
  "Menstrual health",
  "Osteoporasis",
  "Sleep Disorders"];
const list = illnesses.map((illness) =>
  <li>{illness}</li>
);

class Home extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1>List of Illnesses</h1>
          <ul>{list}</ul>
        </header>
      </div>
    );
  }
}

export default App;
